import React, {useState} from 'react';

function Example(){
    //Declare a state which is count = 0.
    const [count, setCount] = useState(0);

    return(
        <div>
            <p>You cliked {count} times</p>
            <button onClick={() => setCount(count + 1)}>
                Click me
            </button>
        </div>
    )
}
export default Example();
